import base64
import zlib
import yaml

# --- Compressed Blobs from blobs.js ---

COLLECTIBLES_COMPRESSED = ''
MISSIONSETS_COMPRESSED = ''
UNLOCKABLES_COMPRESSED = ''
LOCATIONS_COMPRESSED = ' '

# --- Decompression Logic ---

def decompress_blob(blob_str):
    """Decompresses a base64 encoded, zlib compressed blob into a string."""
    try:
        compressed_data = base64.b64decode(blob_str)
        decompressed_data = zlib.decompress(compressed_data)
        return decompressed_data.decode('utf-8')
    except Exception as e:
        print(f"Error decompressing blob: {e}")
        return None

def load_yaml_blob(blob_str):
    """Loads and parses a compressed YAML blob into a Python object."""
    decompressed_text = decompress_blob(blob_str)
    if decompressed_text:
        try:
            return yaml.safe_load(decompressed_text)
        except yaml.YAMLError as e:
            print(f"Error parsing YAML: {e}")
            return None
    return None

def load_array_blob(blob_str):
    """Loads and parses a compressed array blob into a Python list."""
    decompressed_text = decompress_blob(blob_str)
    if decompressed_text:
        return decompressed_text.split(',')
    return []

# --- Loaded Data ---

COLLECTIBLES = load_yaml_blob(COLLECTIBLES_COMPRESSED)
MISSIONSETS = load_yaml_blob(MISSIONSETS_COMPRESSED)
UNLOCKABLES = load_yaml_blob(UNLOCKABLES_COMPRESSED)
LOCATIONS = load_array_blob(LOCATIONS_COMPRESSED)
